import React from 'react';
import { NavLink } from 'react-router-dom';

function Sidebar() {
    return (
        <aside>
            <nav>
                <ul>
                    <li><NavLink exact to="/" activeClassName="active"><FontAwesomeIcon icon="home" />Home</NavLink></li>
                    <li><NavLink to="/account" activeClassName="active">Account</NavLink></li>
                    <li><NavLink to="/people" activeClassName="active">People</NavLink></li>
                </ul>
            </nav>
        </aside>
    );
}

export default Sidebar;
